const Dates = (props) => {
  let date = props.date;
  const year = date.getFullYear;
  const month = date.getMonth;
  const day = date.getDay;
  return (
    <div>
      <div>{day}</div>
      <div>{month}</div>
      <div>{year}</div>
    </div>
  );
};
export default Dates;
